import copy
import collections


class Solution:
    def updateMatrix_BFS_addlevel(self, matrix): #BFS
        m, n = len(matrix), len(matrix[0])
        dist = [[0] * n for _ in range(m)]
        zeroes_pos = [(i, j) for i in range(m) for j in range(n) if matrix[i][j] == 0]
        # 将所有的 0 添加进初始队列中
        q = collections.deque(zeroes_pos)
        seen = set(zeroes_pos)
        level = 1
        while q:
            size = len(q)
            while size:
                i, j = q.popleft()
                for ni, nj in [(i - 1, j), (i + 1, j), (i, j - 1), (i, j + 1)]:
                    if 0 <= ni < m and 0 <= nj < n and (ni, nj) not in seen:
                        dist[ni][nj] = level
                        q.append((ni, nj))
                        seen.add((ni, nj))
                size -= 1
            level += 1
        return dist



    def updateMatrix_BFS_demo(self, matrix): # BFS
        m, n = len(matrix), len(matrix[0])
        dist = [[0] * n for _ in range(m)]
        zeroes_pos = [(i, j) for i in range(m) for j in range(n) if matrix[i][j] == 0]
        # 将所有的 0 添加进初始队列中
        q = collections.deque(zeroes_pos)
        seen = set(zeroes_pos)

        # 广度优先搜索
        while q:
            i, j = q.popleft()
            for ni, nj in [(i - 1, j), (i + 1, j), (i, j - 1), (i, j + 1)]:
                if 0 <= ni < m and 0 <= nj < n and (ni, nj) not in seen:
                    dist[ni][nj] = dist[i][j] + 1
                    q.append((ni, nj))
                    seen.add((ni, nj))

        return dist


    def updateMatrix_BFS_0(self, mat): # BFS暴力解法
        '''
        我多用了一个deque来区分每一层，保证每一层循环之后，再循环下一层
        其实可以参考：size作为这一层的数量，用while size递减，保证这一层结束了，开始下一层，开始下一层的时候level再自增
        level = 0
        while queue 不空：
            size = queue.size()
            while (size --) {
                cur = queue.pop()
                for 节点 in cur的所有相邻节点：
                    if 该节点有效且未被访问过：
                        queue.push(该节点)
            }
            level ++;
        '''
        if not mat:
            return mat
        m, n = len(mat), len(mat[0])
        new_mat = copy.deepcopy(mat)
        for sr in range(m):
            for sl in range(n):
                flag_mat = copy.deepcopy(mat)
                print(sr,sl)
                if mat[sr][sl] == 0:
                    new_mat[sr][sl] = 0
                else:
                    global min_dins
                    min_dins = 1
                    todo_due = collections.deque()
                    doing_due = collections.deque([[sr, sl]])
                    while doing_due:
                        thex, they = doing_due.popleft()
                        if mat[thex][they] == 0:
                            new_mat[thex][they] = min_dins
                            break
                        flag_mat[sr][sl] = 2
                        for nx, ny in [[thex - 1, they], [thex + 1, they], [thex, they - 1], [thex, they + 1]]:
                            if 0 <= nx < m and 0 <= ny < n:
                                if flag_mat[nx][ny] == 2:
                                    continue
                                if mat[nx][ny] == 0:
                                    flag_mat[nx][ny] = 2
                                    new_mat[sr][sl] = min_dins
                                    doing_due = None
                                    todo_due = collections.deque() # 这里需要增加把todo_due置成空
                                    break
                                else:
                                    todo_due.append([nx,ny])
                        if not doing_due and todo_due:
                            min_dins += 1
                            doing_due = todo_due
                            todo_due = collections.deque()
        return new_mat

